import { useParams } from "react-router-dom";

const EventsDetail = (props) => {
    const params = useParams();

    return (
        <>
            <h1>Events Detail</h1>
            <p>Event ID: {params.eventId}</p>
        </>
    )
};

export default EventsDetail;
